/***** DEFINITION OF DIGITAL INPUT PINS *****/
const uint8_t sonar_HC-SR04_Echo_PIN_D3	= 3;

/***** DEFINITION OF DIGITAL OUTPUT PINS *****/
const uint8_t sonar_HC-SR04_Trigger_PIN_D2	= 2;

/***** DEFINITION OF PWM OUTPUT PINS *****/
